import{d as l,c as a,a as t,t as s,u as n,F as h,r as d,o as r}from"./index-b588b897.js";const p={title:"About me and my programming journey",sections:[{title:"How I started",desc:'I started programming back in 2020 by completing a five-course series about Python on Coursera (<a href="https://www.coursera.org/learn/python">1</a>, <a href="https://www.coursera.org/learn/python-data">2</a>, <a href="https://www.coursera.org/learn/python-network-data">3</a>, <a href="https://www.coursera.org/learn/python-databases">4</a>, <a href="https://www.coursera.org/learn/python-data-visualization">5</a>). After that, for the next two years I have been mostly writing web scrapers, bots and little scripts with Python.'},{title:"What I did from there",desc:'At the end of 2022 I started learning more about C++, and tried writing some projects with it (<a href="https://github.com/kutoru/sudoku-gui">one of those projects</a>). A bit later I got interested in other languages that I never tried before, such as Rust, Go and JavaScript, and wrote some projects with them as well (<a href="https://github.com/kutoru">some of those projects</a>). Most recently I have been learning a lot about backend and frontend web development, while creating projects with Go and Vue. I have also learned a lot about data structures, algorihtms and memory management after completing <a href="https://frontendmasters.com/courses/algorithms">this</a> course in C (i uploaded my course progress <a href="https://github.com/kutoru/data-structures-and-algorithms">here</a>). I also wrote more about how I wrote some projects and what I learned from them <a href="/projects">here</a>.'}]},w={title:"Обо мне и моём пути обучения программированию",sections:[{title:"Как я начинал",desc:'Я начал программировать в 2020 году, пройдя серию из пяти курсов по Python на Coursera (<a href="https://www.coursera.org/learn/python">1</a>, <a href="https://www.coursera.org/learn/python-data">2</a>, <a href="https://www.coursera.org/learn/python-network-data">3</a>, <a href="https://www.coursera.org/learn/python-databases">4</a>, <a href="https://www.coursera.org/learn/python-data-visualization">5</a>). После этого в течение следующих двух лет я в основном писал веб-скраперы, ботов и небольшие скрипты на Python.'},{title:"Что я делал после этого",desc:'В конце 2022 года я начал больше изучать C++ и попробовал написать на нём несколько проектов (<a href="https://github.com/kutoru/sudoku-gui">один из тех проектов</a>). Чуть позже я заинтересовался другими языками которые раньше никогда не пробовал, такими как Rust, Go и JavaScript, и написал на них несколько проектов (<a href="https://github.com/kutoru">некоторые из этих проектов</a>). Совсем недавно я много узнал о бэкэнд и фротнэнд веб-разработке, создавая проекты на Go и Vue. Я также много узнал о структурах данных, алгоритмах и управлении памятью после завершения <a href="https://frontendmasters.com/courses/algorithms">этого</a> курса на C (я загрузил мой прогресс курса <a href="https://github.com/kutoru/data-structures-and-algorithms">здесь</a>). Я также написал больше о том как я писал некоторые проекты и чему они меня научили <a href="/projects">здесь</a>.'}]},u={en:p,ru:w},m={class:"text-block center"},g={class:"header-text"},f={class:"title-text"},b=t("br",null,null,-1),y=["innerHTML"],j=l({__name:"AboutView",setup(_){const i=localStorage.getItem("lang");let e;return i==="ru"?e=u.ru:e=u.en,(k,I)=>(r(),a(h,null,[t("div",m,[t("span",g,s(n(e).title),1)]),(r(!0),a(h,null,d(n(e).sections,(o,c)=>(r(),a("div",{class:"text-block",key:c},[t("span",f,s(o.title),1),b,t("span",{innerHTML:o.desc},null,8,y)]))),128))],64))}});export{j as default};
